const generateMockData = (count: number): LeaderboardEntry[] => {
  const data: LeaderboardEntry[] = [];
  for (let i = 0; i < count; i++) {
    const name = `${firstNames[Math.floor(Math.random() * firstNames.length)]} ${lastInitials[Math.floor(Math.random() * lastInitials.length)]}.`;
    // Random weekly minutes between 2 hours (120) and 30 hours (1800)
    const totalMinutes = Math.floor(Math.random() * (1800 - 120 + 1)) + 120;
    data.push({
      id: i + 1,
      name,
      totalMinutes,
    });
  }
  return data;
};

export const MOCK_LEADERBOARD_DATA: LeaderboardEntry[] = [
    ...topPerformers,
    ...generateMockData(200)
];